description:
Animaciaj versioj de Aziaj fabeloj/Animated versions of Asian tales.

Animaciaj versioj de china, korea kaj nanaa fabeloj, kreitaj en Sojuzmultfilm-studio en la komenco de la 1950-aj jaroj. Kun subtitoloj en Esperanto. Pli detalan informon oni povas trovi che: http://kinejo.blogsome.com/category/animaciaj/

Soviet animated versions of Chinese, Korean and Nanai folk tales, created in the beginning of the 1950s. With internal subtitles in Esperanto.

1.Fratoj Lu/Brothers Lu (1953)
2.Kuragha Pak/Brave Pak (1953)
3.Koro de kuraghulo/Heart of brave man (1951)

Dauro/Duration: 27 + 20 + 17m

